import React, { useState } from "react";
import Content from "../../components/Content";
import PsicologoServices from "../../services/PsicologoServices";

const PsicologosAdd = () => {
    const [nomPsicolgo, setnomPsicologo] = useState("");
    const [ap1Psicolgo, setap1Psicologo] = useState("");
    const [ap2Psicolgo, setap2Psicologo] = useState("");
    const [edadPsicolgo, setedadPsicologo] = useState("");
    const [sexoPsicolgo, setsexoPsicologo] = useState("");
    const [especialidad, setEspecialidad] = useState("");

    const handlePsicologo = (event) => {
        setnomPsicologo(event.target.value);
      };
    const handleap1Psicologo = (event) => {
        setap1Psicologo(event.target.value);
      };
    const handleap2Psicologo = (event) => {
        setap2Psicologo(event.target.value);
      };
    const handleedadPsicologo = (event) => {
        setedadPsicologo(event.target.value);
      };
    const handlesexoPsicologo = (event) => {
        setsexoPsicologo(event.target.value);
      };
    const handleEspecialidad = (event) => {
        setEspecialidad(event.target.value);
      };
    
    const handleSubmit = () => {
    let psicologo = {
      nomPsicologo: nomPsicolgo,
      ap1Psicologo: ap1Psicolgo,
      ap2Psicologo: ap2Psicolgo,
      edadPsicologo: edadPsicolgo,
      sexoPsicologo: sexoPsicolgo,
      especialidad: especialidad
    };
    
    // const { data } = await axios.post(`${server}/alumnos`, alumno);
    console.log(psicologo);
    PsicologoServices.createPsicologo(psicologo);
    };

    return (
        <Content>
          <h1>CAPTURA DE PSICLOGO</h1>
          <label>
            Psicolgo:
            <input type="text" name="nomPsicolgo" onChange={handlePsicologo} />
          </label>
          &nbsp; &nbsp;
          <label>
            Ap1:
            <input type="text" name="ap1Psicolgo" onChange={handleap1Psicologo} />
          </label>
          &nbsp; &nbsp;
          <label>
            Ap2:
            <input type="text" name="ap2Psicolgo" onChange={handleap2Psicologo} />
          </label>
          &nbsp; &nbsp;
          <label>
            Edad:
            <input type="text" name="edadPsicolgo" onChange={handleedadPsicologo} />
          </label>
          &nbsp; &nbsp;
          <label>
            Sexo:
            <input type="text" name="sexoPsicolgo" onChange={handlesexoPsicologo} />
          </label>
          &nbsp; &nbsp;
          <label>
            Especialidad:
            <input type="text" name="especialidad" onChange={handleEspecialidad} />
          </label>
          &nbsp; &nbsp; &nbsp;
          <button onClick={handleSubmit}> Ingresar </button>
        </Content>
      );
    };
    
    export default PsicologosAdd;
